        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵtext"](222, "\u05D4\u05D0\u05EA\u05E8 \u05E9\u05D5\u05DE\u05E8 \u05D0\u05EA \u05D6\u05DB\u05D5\u05EA\u05D5 \u05DC\u05E9\u05E0\u05D5\u05EA \u05D0\u05EA \u05E9\u05DD \u05D4\u05DE\u05E9\u05EA\u05DE\u05E9 \u05E9\u05D1\u05D7\u05E8\u05EA \u05D0\u05D5 \u05DC\u05D4\u05E1\u05D9\u05E8 \u05D0\u05D5\u05EA\u05D5 \u05D1\u05DE\u05D9\u05D3\u05D4 \u05D5\u05D9\u05D9\u05E7\u05D1\u05E2 \u05DB\u05D9 \u05E9\u05DD \u05D4\u05DE\u05E9\u05EA\u05DE\u05E9 \u05D0\u05D9\u05E0\u05D5 \u05D4\u05D5\u05DC\u05DD \u05D0\u05D5 \u05DE\u05D2\u05D5\u05E0\u05D4, \u05DC\u05E9\u05D9\u05E7\u05D5\u05DC \u05D3\u05E2\u05EA\u05D5 \u05D4\u05D1\u05DC\u05E2\u05D3\u05D9 \u05E9\u05DC \u05D4\u05D0\u05EA\u05E8.");
