        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵtext"](226, "\u05DE\u05EA\u05DF \u05D4\u05E9\u05D9\u05E8\u05D5\u05EA \u05D9\u05EA\u05D0\u05E4\u05E9\u05E8 \u05D1\u05DB\u05E4\u05D5\u05E3 \u05DC\u05E9\u05D9\u05E7\u05D5\u05DC \u05D3\u05E2\u05EA\u05D5 \u05D4\u05D1\u05DC\u05E2\u05D3\u05D9 \u05E9\u05DC \u05D4\u05D0\u05EA\u05E8 \u05D5\u05D4\u05D0\u05EA\u05E8 \u05DC\u05D0 \u05D9\u05D4\u05D0 \u05D0\u05D7\u05E8\u05D0\u05D9 \u05DC\u05DB\u05DC \u05D0\u05D9\u05D7\u05D5\u05E8 \u05D5/\u05D0\u05D5 \u05E2\u05D9\u05DB\u05D5\u05D1 \u05D1\u05DE\u05EA\u05DF \u05D4\u05E9\u05D9\u05E8\u05D5\u05EA \u05D5/\u05D0\u05D5 \u05D0\u05D9-\u05DE\u05EA\u05DF \u05D4\u05E9\u05D9\u05E8\u05D5\u05EA, \u05DB\u05EA\u05D5\u05E6\u05D0\u05D4 \u05DE\u05DB\u05D5\u05D7 \u05E2\u05DC\u05D9\u05D5\u05DF \u05D5/\u05D0\u05D5 \u05EA\u05E7\u05DC\u05D5\u05EA \u05D8\u05DB\u05E0\u05D9\u05D5\u05EA \u05D5/\u05D0\u05D5 \u05DE\u05D0\u05D9\u05E8\u05D5\u05E2\u05D9\u05DD \u05E9\u05D0\u05D9\u05E0\u05DD \u05D1\u05E9\u05DC\u05D9\u05D8\u05EA\u05D5, \u05DC\u05E8\u05D1\u05D5\u05EA \u05EA\u05E7\u05DC\u05D5\u05EA \u05D8\u05DB\u05E0\u05D9\u05D5\u05EA \u05D0\u05D5 \u05D0\u05D7\u05E8\u05D5\u05EA \u05D0\u05E6\u05DC \u05E6\u05D3 \u05E9\u05DC\u05D9\u05E9\u05D9.");
