        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵtext"](627, "\u05DB\u05DC \u05D6\u05DB\u05D5\u05D9\u05D5\u05EA \u05D4\u05D9\u05D5\u05E6\u05E8\u05D9\u05DD \u05D5\u05D4\u05E7\u05E0\u05D9\u05D9\u05DF \u05D4\u05E8\u05D5\u05D7\u05E0\u05D9 \u05D4\u05DD \u05D1\u05D1\u05E2\u05DC\u05D5\u05EA \u05D4\u05D0\u05EA\u05E8 \u05D1\u05DC\u05D1\u05D3, \u05D0\u05D5 \u05D1\u05D1\u05E2\u05DC\u05D5\u05EA \u05E6\u05D3 \u05E9\u05DC\u05D9\u05E9\u05D9, \u00A0\u05E9\u05D4\u05E8\u05E9\u05D4 \u05DC\u05D0\u05EA\u05E8 \u05DC\u05E2\u05E9\u05D5\u05EA \u05E9\u05D9\u05DE\u05D5\u05E9 \u05E2\u05DC \u05E4\u05D9 \u05D3\u05D9\u05DF \u05D1\u05EA\u05DB\u05E0\u05D9\u05DD \u05D0\u05DC\u05D5 \u05D5\u05D1\u05DB\u05DC\u05DC \u05D6\u05D4 \u05E9\u05D5\u05EA\u05E4\u05D9\u05D4 \u05D4\u05E2\u05E1\u05E7\u05D9\u05D9\u05DD \u05E9\u05DC \u05D4\u05D0\u05EA\u05E8. \u05DC\u05E9\u05D5\u05EA\u05E4\u05D9\u05D4 \u05D4\u05E2\u05E1\u05E7\u05D9\u05D9\u05DD \u05E9\u05DC \u05D4\u05D0\u05EA\u05E8 \u05D0\u05E9\u05E8 \u05DE\u05E2\u05DC\u05D9\u05DD \u05D0\u05EA \u05D7\u05D1\u05D9\u05DC\u05D5\u05EA \u05D4\u05E7\u05DC\u05E4\u05D9\u05DD \u05E9\u05DC\u05D4\u05DD \u2013 \u05D6\u05DB\u05D5\u05D9\u05D5\u05EA \u05D4\u05E7\u05E0\u05D9\u05D9\u05DF \u05E9\u05DC\u05D4\u05DD \u05D9\u05D9\u05E9\u05DE\u05E8\u05D5 \u05D5\u05D1\u05EA\u05E0\u05D0\u05D9 \u05E9\u05D0\u05D9\u05DF \u05DE\u05D3\u05D5\u05D1\u05E8 \u05D1\u05D4\u05E4\u05E8\u05D4 \u05E9\u05DC \u05D6\u05DB\u05D5\u05D9\u05D5\u05EA \u05D0\u05D7\u05E8\u05D5\u05EA \u05E9\u05DC \u05D4\u05D0\u05EA\u05E8, \u05D0\u05D5 \u05E9\u05DC \u05D2\u05D5\u05E8\u05DD \u05E6\u05D3 \u05E9\u05DC\u05D9\u05E9\u05D9 \u05D0\u05D7\u05E8.");
        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_1__["ɵɵelementStart"](628, "li", 18);
